CREATE DEFINER=`root`@`localhost` PROCEDURE `spCitasAlumno` (IN `matricula` INT(8), IN `estado` VARCHAR(50))  BEGIN
		DECLARE nombre VARCHAR(150);
		SET nombre = (SELECT CONCAT_WS(' ',tblalum_docen.`vchNombre`, tblalum_docen.`vchAPaterno`, tblalum_docen.`vchAMaterno`) FROM tblalum_docen WHERE tblalum_docen.`intMatricula`=matricula);
		
