CREATE DEFINER=`root`@`localhost` PROCEDURE `spGetCitaDocente` (IN `idDocente` VARCHAR(100), IN `page` INT)  BEGIN
	declare nombre varchar(150);
	declare lim int;
	set nombre = (select concat_ws(' ',tblalum_docen.`vchNombre`, tblalum_docen.`vchAPaterno`, tblalum_docen.`vchAMaterno`) from tblalum_docen where tblalum_docen.`intMatricula`=idDocente);
	if page = 0 then
		SELECT *, nombre AS Nombre_Docente FROM view_citas_docente WHERE Estado_Cita="Aprobado" AND view_citas_docente.`idDocente`=idDocente
		ORDER BY view_citas_docente.`Fecha_Cita` ASC, view_citas_docente.`Hora` limit 0,5;
	else 
		set lim = page-5;
		SELECT *, nombre AS Nombre_Docente FROM view_citas_docente WHERE Estado_Cita="Aprobado" AND view_citas_docente.`idDocente`=idDocente
		ORDER BY view_citas_docente.`Fecha_Cita` ASC, view_citas_docente.`Hora` LIMIT lim,page;
	end if;
	END$$

