CREATE DEFINER=`root`@`localhost` PROCEDURE `spGetHistorial` (IN `idDocente` INT, IN `estado` VARCHAR(30), IN `page` INT)  BEGIN
	DECLARE nombre VARCHAR(150);
	DECLARE lim INT;
	SET nombre = (SELECT CONCAT_WS(' ',tblalum_docen.`vchNombre`, tblalum_docen.`vchAPaterno`, tblalum_docen.`vchAMaterno`) FROM tblalum_docen WHERE tblalum_docen.`intMatricula`=idDocente);
	if estado = 'Todos' then
		IF page = 0 THEN
			SELECT *, nombre AS Nombre_Docente FROM view_citas_docente WHERE view_citas_docente.`idDocente`=idDocente
			ORDER BY view_citas_docente.`Fecha_Cita` ASC, view_citas_docente.`Hora` LIMIT 0,5;
		ELSE 
			SET lim = page-5;
			SELECT *, nombre AS Nombre_Docente FROM view_citas_docente WHERE view_citas_docente.`idDocente`=idDocente
			ORDER BY view_citas_docente.`Fecha_Cita` ASC, view_citas_docente.`Hora` LIMIT lim,page;
		END IF;
	else
		IF page = 0 THEN
			SELECT *, nombre AS Nombre_Docente FROM view_citas_docente WHERE Estado_Cita=estado  AND view_citas_docente.`idDocente`=idDocente
			ORDER BY view_citas_docente.`Fecha_Cita` ASC, view_citas_docente.`Hora` LIMIT 0,5;
		ELSE 
			SET lim = page-5;
			SELECT *, nombre AS Nombre_Docente FROM view_citas_docente WHERE Estado_Cita=estado AND view_citas_docente.`idDocente`=idDocente
			ORDER BY view_citas_docente.`Fecha_Cita` ASC, view_citas_docente.`Hora` LIMIT lim,page;
		END IF;
	end if;
	END$$

